import React from 'react'
import styled from 'styled-components'
import { Footer } from '../components/Footer'
import { NavBar } from '../components/NavBar'
import { Colors } from '../components/StyledComponents'

export const Home = () => {
    return (
        <>
        <HomeHolder>
            <HomeLeft>
                <HomeHeader>
                    The Affordable Email Marketing tool for Creators!    
                </HomeHeader>
                <HomeDesc>
                    MailKeo gives a cost effective solution for your Email Marketing problems.
                </HomeDesc>
                <HomeCTA href="/signup">
                    Start Campaigning for Free
                </HomeCTA>
            </HomeLeft>
            <HomeRight>
                <HomeSvg1/>
            </HomeRight>
        </HomeHolder>
        <NavBar/>
        <Footer/>  
        </>
    )
}

const HomeHeader = styled.div`

    font-size: 48px;
    font-weight: 600;
    width: 100%;
    max-width: 520px;
    color: ${Colors.primary};
    transition: 300ms ease-in-out;
    @media (max-width: 1100px)
        {
            max-width: 100%;
            text-align: center;
        }
    
    @media (max-width: 640px)
        {
            font-size: 36px;
        }

`

const HomeDesc = styled.div`
    transition: 300ms ease-in-out;
    font-size: 20px;
    font-weight: 400;
    width: 100%;
    max-width: 520px;
    color: ${Colors.dark};
    padding-right: 40px;

    @media (max-width: 1100px)
        {
            padding-right: 28px;
            padding-left: 28px;
            max-width: 100%;
            text-align: center;
            margin-top: 20px;
            margin-bottom: 32px;
        }

    @media (max-width: 640px)
        {
            font-size: 16px;
        }

`

const HomeCTA = styled.a`

    transition: 300ms ease-in-out;
    width: 320px;
    height: 56px;

    font-weight: 500;
    font-size: 20px;
    display: flex;
    align-items: center;
    justify-content: center;

    background-color: ${Colors.primary};
    color: ${Colors.light};
    border-radius: 5px;

    @media (max-width: 1100px)
    {
        width: 240px;
        font-size: 16px;
    }

`

const HomeLeft = styled.div`

    transition: 300ms ease-in-out;
    margin-left: 18.75%;
    height: 360px;
    display:flex;
    flex-direction: column;
    align-items: flex-start;
    justify-content: space-between;

    @media (max-width: 1366px)
        {
            margin-left: 12.5%;
        }
    @media (max-width: 1100px)
        {
            height: 100%;
            margin-right: 12.5%;
            margin-bottom: 40px;
            align-items:center;
        }
`

const HomeRight = styled.div`

    transition: 300ms ease-in-out;
    margin-right: 18.75%;
    height: 360px;
    display:flex;
    align-items: center;
    justify-content: center;

    @media (max-width: 1366px)
        {
            margin-right: 12.5%;
        }
    
    @media (max-width: 1100px)
        {
            margin-left: 12.5%;
            height: 100%;
            width: 75%;
        }

`

const HomeHolder = styled.div`

    transition: 300ms ease-in-out;
    position: relative;
    top: 240px;
    left: 50%;
    transform: translate(-50%);
    display: flex;
    align-items: center;
    justify-content: space-between;

    @media (max-width: 1100px)
        {
            top: 160px;
            align-items: center;
            justify-content: center;
            flex-direction: column;
        }
`

const HomeSvg = styled.svg`

    width: 390px;
    transition: 300ms ease-in-out;
    @media(max-width: 1100px)
        {
            width: 100%;
            max-width: 480px;
            margin-bottom: 160px;
        }
`

